'Tetramethylethylenediamine' ('TMEDA' or 'TEMED') is a chemical compound with
the formula (CH 3) 2NCH 2CH 2N(CH 3-
) 2. This species is derived from ethylenediamine by replacement
of the four N-H groups with four N-methyl groups. Its odor is remarkably similar
to that of fish.
